:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  VDAVIES, George Henry and GODFREY, Rose Alma
  VDAVIES, Christopher ap Rhys and HAWKES, Lilian Margaret
  JDAVIES, Helen Rose and VICKERMAN, John D'Arcy
  JVICKERMAN, Judith Anne and BEVIN, Nicholas Peter
  VICKERMAN, Judith Anne and BEVIN, Nicholas Peter (cont...)
  Having always been creative, Judith, along with school friend Suzanne Willis, began Freehand, a
  handpainting textile business specialising in cushions, duvet covers, oven mits, tea cosies and
  pictures. Her other interests include landscape gardening, tapestry and pottering creatively. She
  enjoys reading, music, film going and relaxing or working on their 25-acre block of land in the
  Wairarapa.
  Nick was educated at Saints Peter and Paul's Primary School, St Bernard's College, Wellington
  Polytechnic and Victoria and Auckland Universities. He was Head Prefect and played for the 1st
  rugby XV in 1973. He undertook a Fashion and Design Course, then became a game-keeper at
  Wellington and Perth Zoos before committing himself to architecture. He worked for Stapleton
  Architects where he became a director. Having won several awards for his work, he now runs his own
  business, Bevin Architects Ltd. His interests include farm forestry, gardening and music film
  going and reading.
  01> BEVIN, Hilary Ngawai
  b 15.03.1984
  Hilary attended Petone Central School and is now at Hutt Valley High School. She was in a
  Maori Enrichment and later a full-immersion programme whilst at primary school and continues
  her love of English and languages at high school. She enjoys netball, basketball, art, piano
  and music.
  02> BEVIN, Sylvia Rose
  b 15.01.1987
  Sylvia attends Petone Central School. Her interests are netball, mini-ball, touch rugby,
  creative pursuits and piano and music.
  03> BEVIN, George Alister Robert
  b 16.05.1989
  George attends Petone Central School where he is an active sportsperson, playing rugby,
  cricket, touch rugby and basketball. He also enjoys music and plays the piano.
  03>' DAVIES, James Pearson (Jim) m on 07.05.1958 to HALSE, Loeta
  b 18.01.1927
  b 19.09.1933
  Si Jim b. at Manaia and m. at St Stephen's Church, Marton. Loeta, d/o Roy Hewitt
  Halse and Mary Louise Searle, b. at Marton. Address: 111 Kawaha Point Road,
  Rotorua.
  Jim was educated at St George's School, Wanganui; Wanganui Collegiate School
  i and Ardmore Teacher's College. He taught at Wanganui Collegiate School
  (1952-58, 1960-61) and at Boys' Grammar School, Suva, Fiji (1958-59). He was
  Bursar at Wanganui Collegiate School (1962-66) then moved to Rotorua where he was branch manager of UDC
  Finance. He taught at Western Heights High School until his retirement in 1989, Jim was involved in
  many sporting activities. He represented Wanganui in rugby, played golf for Fiji Eastern Zone and won
  the Fiji Golf Club Open in 1959. He was an active member of Lions International (1972-83) and President
  of the Ngongotaha Lions Club in 1976. Both he and Loeta have played a prominent role in the American
  Field Scholarship Programme and Jim was on the New Zealand Selection Panel for two years.
  Loeta was educated at Wellington Diocesan School for Girls, Nga Tawa (1947-50). She was President of
  the Nga Tawa Old Girls' Association and was President of the Rotorua Chapter of the American Field
  Service (1978-80). She currently serves as a co-opted member of the Rotorua District Council Tourism
  Promotion Committee. Loeta was a charter member and Past President of the Quota Club in Rotorua and is
  a Governing Director of a Licensed Employment Agency for Personnel Services.
